export const FETCH_TWEETS = 'FETCH_TWEETS';
export const fetchTweets = () => async dispatch => {
  dispatch({
    type: FETCH_TWEETS,
    payload: tweets
  })
};

export const LIKE_TWEET = 'LIKE_TWEET';
export const likeTweet = (id, username) => async dispatch => {
  dispatch({
    type: LIKE_TWEET,
    payload: {id, username}
  })
};

export const DISLIKE_TWEET = 'DISLIKETWEET';
export const dislikeTweet = (id, username) => async dispatch => {
  dispatch({
    type: DISLIKE_TWEET,
    payload: { id, username }
  })
};

export const SET_MOVE_SCREEN = 'SET_MOVE_SCREEN';
export const setMoveScreen = value => ({
  type: SET_MOVE_SCREEN,
  payload: value
});

export const FETCH_CLIENT = 'FETCH_CLIENT';
export const fetchClient = email => async dispatch => {
  dispatch({
    type: FETCH_CLIENT,
    payload: client
  })
};

export const NEW_TWEET = 'NEW_TWEET';
export const newTweet = tweetData => async dispatch => {
  dispatch({
    type: NEW_TWEET,
    payload: [tweetData]
  })
};

export const NEW_COMMENT = 'NEW_COMMENT';
export const newComment = (tweetId, commentData) => async dispatch => {
  dispatch({
    type: NEW_COMMENT,
    payload: { tweetId, commentData }
  })
};